import React, { useEffect, useState } from 'react';
import Layout from '../../Components/Layout/Layout'
import { Container } from 'react-bootstrap'
import { Table } from 'react-bootstrap'
import axios from '../../helpers/axios';
import { useSelector } from 'react-redux';


const Result = (props) => {
    const userId = props.match.params.userId;
    const [results, setResults] = useState([]);
    const [error, setError] = useState("");
    const [modeltests, setModeltests] = useState({});
    const courses = useSelector(state => state.course.courses);
    const course = courses?.find(x => x._id === results?.courseId);
    useEffect(async () => {
        try {
            const res = await axios.get(`/get/all/results/${userId}`);
            setResults(res.data.result);
        } catch (err) {
            setError("Something wrong!");
        }
    }, []);
    console.log(course?.slug)
    useEffect(async () => {
        try {
            const res = await axios.get(`/get/model-tests/${course.slug}`);
            setModeltests(res.data.modeltests);
        } catch (err) {
            setError("Something wrong!");
        }
    }, []);
    function capitalize(str) {
        return str?.charAt(0).toUpperCase() + str?.slice(1);
    }
    console.log(modeltests)
    return (
        <Layout>
            <div className="mainDiv">
                <Container>
                    <h1>Your all result history : </h1>
                    <div style={{ marginTop: '30px' }}>
                        <Table responsive="md">
                            <thead>
                                <tr>
                                    <th>#</th>
                                    <th>Model Name</th>
                                    <th>Course Name</th>
                                    <th>Unit Name</th>
                                    <th>Number of attempts</th>
                                    <th>Score</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    results.map((item, index) => {

                                        const course = courses?.find(x => x._id === item?.courseId);
                                        return (
                                            <tr key={index}>
                                                <td>{index + 1}</td>
                                                <td>{item?._id}</td>
                                                <td>{capitalize(course?.courseName)}</td>
                                                <td>{
                                                    item.unitId ? item.unitId : '-'
                                                }</td>
                                                <td>{item.attempt}</td>
                                                <td>{item.mark}</td>
                                            </tr>

                                        )
                                    })
                                }

                            </tbody>
                        </Table>
                    </div>

                </Container>
            </div>
        </Layout>
    );
};

export default Result;
